                "tie], [admission_class], [admission_session], [tc_date], [current_session], [rec" +
                "eipt_id], [student_category], [section], [class], [concession], [block_payment]," +
                " [reason]) VALUES (@student_id, @first_name, @middle_name, @last_name, @father_n" +
                "ame, @mother_name, @gender, @dob, @category, @house_no, @locality, @ward, @city," +
                " @state, @pincode, @mobile, @phone, @guardian_name, @g_house_no, @g_locality, @g" +
                "_ward, @g_city, @g_state, @g_pincode, @g_mobile, @g_phone, @samagra_id, @bank_na" +
                "me, @bank_ac_no, @bank_ifsc_code, @adhar_card, @admission_date, @admission_fees," +
                " @furniture_fund, @caution, @belt_tie, @admission_class, @admission_session, @tc" +
                "_date, @current_session, @receipt_id, @student_category, @section, @class, @conc" +
                "ession, @block_payment, @reason);\r\nSELECT student_id, first_name, middle_name, l" +
                "ast_name, father_name, mother_name, gender, dob, category, house_no, locality, w" +
                "ard, city, state, pincode, mobile, phone, guardian_name, g_house_no, g_locality," +
                " g_ward, g_city, g_state, g_pincode, g_mobile, g_phone, samagra_id, bank_name, b" +
                "ank_ac_no, bank_ifsc_code, adhar_card, admission_date, admission_fees, furniture" +
                "_fund, caution, belt_tie, admission_class, admission_session, tc_date, current_s" +
                "ession, receipt_id, student_category, section, class, concession, block_payment," +
                " reason, CASE WHEN student_details.admission_class IN (\'NUR\') THEN \'NUR\' WHEN st" +
                "udent_details.admission_class IN (\'KG1\') THEN \'KG 1\' WHEN student_details.admiss" +
                "ion_class IN (\'KG2\') THEN \'KG 2\' WHEN student_details.admission_class IN (\'001\')" +
                " THEN \'I\' WHEN student_details.admission_class IN (\'002\') THEN \'II\' WHEN student" +
                "_details.admission_class IN (\'003\') THEN \'III\' WHEN student_details.admission_cl" +
