                "\' WHEN student_details.admission_class IN (\'006\') THEN \'VI\' WHEN student_details" +
                ".admission_class IN (\'007\') THEN \'VII\' WHEN student_details.admission_class IN (" +
                "\'008\') THEN \'VIII\' WHEN student_details.admission_class IN (\'009\') THEN \'IX\' WHE" +
                "N student_details.admission_class IN (\'010\') THEN \'X\' WHEN student_details.admis" +
                "sion_class IN (\'C1P\') THEN \'XI COM\' WHEN student_details.admission_class IN (\'C1" +
                "I\') THEN \'XI IP\' WHEN student_details.admission_class IN (\'S11\') THEN \'XI SC\' WH" +
                "EN student_details.admission_class IN (\'C2P\') THEN \'XII COM\' WHEN student_detail" +
                "s.admission_class IN (\'C2I\') THEN \'XII IP\' WHEN student_details.admission_class " +
                "IN (\'S12\') THEN \'XII SC\' END AS theClass FROM student_details WHERE (student_id " +
                "= @student_id) ORDER BY (CASE WHEN student_details.admission_class IN (\'NUR\') TH" +
                "EN 1 WHEN student_details.admission_class IN (\'KG1\') THEN 2 WHEN student_details" +
