                "nt_details.admission_class IN (\'006\') THEN 9 WHEN student_details.admission_clas" +
                "s IN (\'007\') THEN 10 WHEN student_details.admission_class IN (\'008\') THEN 11 WHE" +
                "N student_details.admission_class IN (\'009\') THEN 12 WHEN student_details.admiss" +
