                "N 14 WHEN student_details.admission_class IN (\'C1I\') THEN 15 WHEN student_detail" +
                "s.admission_class IN (\'S11\') THEN 16 WHEN student_details.admission_class IN (\'C" +
                "2P\') THEN 17 WHEN student_details.admission_class IN (\'C2I\') THEN 18 WHEN studen" +
